script: |
  super -f text -I q11085.spq | sort > q11085.out

inputs:
  - name: q11085.spq
    data: |
      SELECT DISTINCT + ( ( cor0.col2 ) ) FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q11085.out
    data: |
      54
      57
      96
